import React from "react";

const Footer = () => {
  return (
    <div className="w-full bg-yellow-400 absolute bottom-0 left-0 right-0 p-4 text-center">
      <p className="text-black font-extrabold text-sm">Found this helpful?</p>
      <div className="grid grid-cols-2">
        <a>Buy me a Beer</a>
        <a>Listen to my band</a>
      </div>
    </div>
  );
};

export default Footer;
